import '../../../presentation/template/template.dart';import '../../models/User/ReqModels/user_md_req.dart';import '../../models/User/user_job_relation_md.dart';import '../../models/User/user_profile_md.dart';import '../../models/User/user_md.dart';@immutableclass AuthState {  const AuthState();  factory AuthState.initial() {    return AuthState();  }  AuthState copyWith() {    return AuthState();  }}///------------------Update Auth Action --------- ///class UpdateAuthStateAction {  UpdateAuthStateAction();}///------------------Auth Action --------- ///class GetLoginAction {  String phoneNumber;  String password;  BuildContext context;  GetLoginAction({    required this.phoneNumber,    required this.password,    required this.context,  });}class GetExistedUserAction {  String userId;  BuildContext context;  GetExistedUserAction({    required this.userId,    required this.context,  });}class GetRegisterAction {  UserModelReq userModelReq;  UserProfileModel userProfileModelReq;  UserJobRelationMd userJobRelationMd;  GetRegisterAction({    required this.userModelReq,    required this.userProfileModelReq,    required this.userJobRelationMd,  });}class GetCheckPhoneNumExistsAction {  String phoneNumber;  GetCheckPhoneNumExistsAction({    required this.phoneNumber,  });}class GetChangePassAction {  String oldPassword;  String newPassword;  GetChangePassAction({required this.oldPassword, required this.newPassword});}class GetChangeLoginIdAction {  String newLoginId;  GetChangeLoginIdAction({    required this.newLoginId,  });}class GetLogoutAction {  GetLogoutAction();}